import React from "react";
import { Company, getCompany } from "../data/companies";
import { useParams } from "react-router-dom";
import { Page } from "./Page";

interface Props {
  companyId: number;
}

const Dealer = () => {
  const { companyId } = useParams();

  const [company, setCompany] = React.useState<Company | undefined>(undefined);

  React.useEffect(() => {
    let company = getCompany(parseInt(companyId));

    setCompany(company);
  }, [companyId]);

  return (
    <Page title={`Update licenses from ${company?.CompanyName}`}>
      <h1>{company?.CompanyName}</h1>

      <div>
        <p>Desktop Licenses: {company?.Licenses}</p>
        <p>Mobile Licenses: {company?.LicensesMobileCount}</p>
        <p>Trial Licenses: {company?.TrialLicenses}</p>
      </div>
    </Page>
  );
};

export default Dealer;
